import React from "react";
import "./ChessPiece.css";

function ChessPiece(props) {
  return (
    <div className='chessPieces'>
      {props.gameState.map((game, indice) => {
        return <span key={indice}>{game}</span>;
      })}
    </div>
  );
}

export default ChessPiece;
